import actionpost from '../actions/index.js';
const oldState = {
    data:[],
    error: false,
}
export const reducer = (state = oldState, action)=>{
    switch (action.type) {
        case actionpost.getDataSuccess().type:
            return {
                ...state,
                
            };
        case actionpost.getDataError().type:
            return state;    
        default:
            return state;
    }
}
